using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// A UIImageAsset object is a container for a collection of images that represent multiple ways of describing a single piece of artwork. A common use case for UIImageAsset is the grouping of multiple images of the same item at different display scales.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIImageAsset_Ref/index.html#//apple_ref/occ/cl/UIImageAsset"/>    [iOSVersion(8)]    [Export("")]    public class UIImageAsset : NSObject//, AnyObject, CVarArgType, Equatable, Hashable, NSCoding, NSObjectProtocol, NSSecureCoding, Printable    {        public UIImageAsset() { }        /// <summary>        /// Associates an image with the trait collection and registers the image to an image asset.        /// </summary>        /// <param name="image">The image to be registered.</param>        /// <param name="withTraitCollection">The UITraitCollection object that the image is registered with.</param>        [iOSVersion(8)]        [Export("registerImage")]        public virtual void RegisterImage(UIImage image, UITraitCollection withTraitCollection) {  }                /// <summary>        /// Removes the image associated with the trait collection from an image asset.        /// </summary>        /// <param name="traitCollection">The UITraitCollection object that is searched for. The found image is removed from the image asset.</param>        [iOSVersion(8)]        [Export("unregisterImageWithTraitCollection")]        public virtual void UnregisterImageWithTraitCollection(UITraitCollection traitCollection) {  }                /// <summary>        /// Returns the image that is registered to an image asset with a specified trait collection.        /// </summary>        /// <param name="traitCollection">The UITraitCollection object to be searched for.</param>        [iOSVersion(8)]        [Export("imageWithTraitCollection")]        public virtual UIImage ImageWithTraitCollection(UITraitCollection traitCollection) { return default(UIImage); }    }}